import React, { useEffect } from 'react';

import '../pages/BannerA.scss';
import MainBannerPrimaryA from '../components/bannera/MainBannerPrimaryA';
import MainBannerPrimaryB from '../components/bannera/MainBannerPrimaryB';
import MainBannerPrimaryC from '../components/bannera/MainBannerPrimaryC';

function BannerA() {

  useEffect(() => {
      document.title = 'Template - Banner A';
  })

  return (
    <>
      <MainBannerPrimaryA />
      <MainBannerPrimaryB />
      <MainBannerPrimaryC />
    </>
  );
}

export default BannerA;
